import CheckBox from '@react-native-community/checkbox';

export default () => {
    const [toggleCheckBox, setToggleCheckBox] = useStat(false)
    return(<CheckBox
      disabled={false}
      value={toggleCheckBox}
      onValueChange={(newValue) => setToggleCheckBox(newValue)}
    />
)}
